import{u as s}from"./composables.4170a9fa.js";import{o as e,I as t,X as i}from"./entry.cc9b0cdc.js";const a=""+new URL("mbr-1024x683.5163b2f6.jpg",import.meta.url).href,l=""+new URL("mbr-1-1332x888.dde254f9.jpg",import.meta.url).href,o=i('<section class="header9 cid-rp3P0ZE4tF mbr-fullscreen" id="header9-d"><div class="mbr-overlay" style="opacity:0.8;background-color:rgb(255, 255, 255);"></div><div class="container"><div class="media-container-column mbr-white col-lg-8 col-md-10"><h1 class="mbr-section-title align-left mbr-bold pb-3 mbr-fonts-style display-1"> About Us</h1><h3 class="mbr-section-subtitle align-left mbr-light pb-3 mbr-fonts-style display-2"> Stay looking your best</h3><p class="mbr-text align-left pb-3 mbr-fonts-style display-5"> We work with some of the best designers in the world to make sure you have the best fashion designs for low prices. Even high end designs are here for incredible prices.\xA0</p><div class="mbr-section-btn align-left"><a class="btn btn-md btn-primary display-4" href="https://www.shopnbold.com/">LEARN MORE</a></div></div></div></section><section class="counters4 counters cid-rp3P45ElkM" id="counters4-e"><div class="container pt-4 mt-2"><h2 class="mbr-section-title pb-3 align-center mbr-fonts-style display-2">The Promise</h2><div class="media-container-row"><div class="media-block m-auto" style="width:49%;"><div class="mbr-figure"><img src="'+a+'" alt="" title=""></div></div><div class="cards-block"><div class="cards-container"><div class="card px-3 align-left col-12"><div class="panel-item p-4 d-flex align-items-start"><div class="card-img pr-3"><h3 class="img-text d-flex align-items-center justify-content-center"> 1 </h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">For Boys and Men of all ages</h4><p class="mbr-content-text mbr-fonts-style display-7"> Shopnbold is a male oriented site, aimed to provide everything from clothing to electronics at reasonable prices. We believe that every man should look and feel their best.\xA0</p></div></div></div><div class="card px-3 align-left col-12"><div class="panel-item p-4 d-flex align-items-start"><div class="card-img pr-3"><h3 class="img-text d-flex align-items-center justify-content-center"> 2 </h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">Everywhere you Are</h4><p class="mbr-content-text mbr-fonts-style display-7"> We know that most of the world is on mobile, but not everyone is using the same device. Our apps are available on iOS, MacOS, FireOS, Tizen, Android, Windows, Blackberry, Linux, Smart TVs, SailfishOS, KaiOS, ChromeOS, and we support all major browsers.</p></div></div></div><div class="card px-3 align-left col-12"><div class="panel-item p-4 d-flex align-items-start"><div class="card-img pr-3"><h3 class="img-text d-flex align-items-center justify-content-center"> 3 </h3></div><div class="card-text"><h4 class="mbr-content-title mbr-bold mbr-fonts-style display-7">We Are Here for you</h4><p class="mbr-content-text mbr-fonts-style display-7"> We are always here for you, rather its to answer questions, give fashion tips with our fashion blog, or anything else within ShopnBold.</p></div></div></div></div></div></div></div></section><section class="features4 cid-rp3P7PmSik" id="features4-f"><div class="container"><div class="media-container-row"><div class="card p-3 col-12 col-md-6"><div class="card-wrapper media-container-row media-container-row"><div class="card-box"><h4 class="card-title pb-3 mbr-fonts-style display-7"><a href="https://www.shopncute.com/blog" class="text-secondary"> Blogging</a></h4><p class="mbr-text mbr-fonts-style display-7"> If you are a fashionable guy, then we want to hear from you. Here on Shopnbold, we offer ways for people to voice their opinions via our blogging tool. Update others on the latest trends and even your own fashion designs.\xA0</p></div></div></div><div class="card p-3 col-12 col-md-6 col-12 col-md-6"><div class="card-wrapper media-container-row"><div class="card-box"><h4 class="card-title pb-3 mbr-fonts-style display-7"><a href="https://www.shopncute.com/designer" class="text-secondary"> B</a>oast About It</h4><p class="mbr-text mbr-fonts-style display-7"> From top to bottom, Shopnbold allows one to be unique while also being acceptable. With fashion trends and electronics to make headturns. Every guy will be glad they stopped by.\xA0</p></div></div></div></div></div></section><section class="features14 cid-rp3P9Q0gKF" id="features14-g"><div class="container align-center"><h2 class="mbr-section-title pb-3 mbr-fonts-style display-2"> The Story of Numbers</h2><h3 class="mbr-section-subtitle pb-5 mbr-fonts-style display-5"> We are proud to launch Shopnbold as a place where men of all ages can gather and shop on their terms. However, we also know that numbers are important so:</h3><div class="media-container-column"><div class="row justify-content-center"><div class="card p-4 col-12 col-md-6 col-lg-4"><div class="media pb-3"><div class="card-img align-self-center"><span class="mbr-iconfont mbri-target"></span></div><div class="media-body"><h4 class="card-title py-2 align-left mbr-fonts-style display-5"> Statistics</h4></div></div><div class="card-box align-left"><p class="mbr-text mbr-fonts-style display-7"> We provide statistics to everyone about what, when, and where something is selling best or least to help you with your buying needs.</p></div></div><div class="card p-4 col-12 col-md-6 col-lg-4"><div class="media pb-3"><div class="card-img align-self-center"><span class="mbr-iconfont mbri-edit"></span></div><div class="media-body"><h4 class="card-title py-2 align-left mbr-fonts-style display-5"> Blog Posts</h4></div></div><div class="card-box align-left"><p class="mbr-text mbr-fonts-style display-7"> We are active on social media and most importantly our blog posts on this site and Meeovi.com. We keep you inform on what is going on with Shopnbold.</p></div></div><div class="card p-4 col-12 col-md-6 col-lg-4"><div class="media pb-3"><div class="card-img align-self-center"><span class="mbr-iconfont mbri-credit-card"></span></div><div class="media-body"><h4 class="card-title py-2 align-left mbr-fonts-style display-5"> Make a profit</h4></div></div><div class="card-box align-left"><p class="mbr-text mbr-fonts-style display-7"> Looking to sell, well our sister site <a href="http://www.meeovi.com" target="_blank">Meeovi.com</a> offers ways to sell your own fashion and other products at any price you want.\xA0</p></div></div></div><div class="media-container-row image-row"><div class="mbr-figure" style="width:60%;"><img src="'+l+'" alt="ShopnBold" title=""></div></div></div></div></section>',4),r=[o],d={},v=Object.assign(d,{__name:"about",setup(n){return s({title:"About Us"}),(c,m)=>(e(),t("div",null,r))}});export{v as default};
